import { Outlet } from 'react-router-dom';
import { ThemeProvider, createGlobalStyle } from 'styled-components';
import theme from './styles/theme';

// 전역 스타일
const globalStyle = {
    margin: '0 auto',

    minHeight: '740px',
    minWidth: '360px',
    maxWidth: '1020px',
};

function App() {
    return (
        <ThemeProvider theme={theme}>
            <GlobalStyle styles={globalStyle}/>
            <>
                <Outlet />
            </>
        </ThemeProvider>
    );
}

export default App;
